import { styled } from './stitches.config';
import Reading from './Reading'

const StyledReadings = styled('ul', {
    margin: '50px 0 0 0',
    flex: '1',
    padding: '0',
    listStyle: 'none',
})

interface ReadingsProps {
    readingList: {text: string, link: string}[]
}

const Readings = ({readingList}: ReadingsProps) => {
    return(
        <StyledReadings>
            {readingList.map((reading)=>{
                return (
                    <Reading text={reading.text} link={reading.link}/>
                )
            })}
        </StyledReadings>
    )
}

export default Readings;
